function shiftItems(order, items, config) {
    var shapes = getSortedItems(order, items, config.tolerance);
    var positions = getShiftPositions(shapes, config.steps);

    for (var i = 0; i < shapes.length; i++) {
        var shape = shapes[i];
        var position = positions[i];
        setItemPosition(shape, position);
    }
    app.redraw();
}


function setItemPosition(item, center) {
    var bounds = item.visibleBounds;
    var x0 = bounds[0];
    var y0 = bounds[1];
    if (isClipped(item)) bounds = item.pageItems[0].visibleBounds;
    var x1 = bounds[0];
    var y1 = bounds[1];
    var x2 = bounds[2];
    var y2 = bounds[3];
    var dx = x0 - x1;
    var dy = y0 - y1;
    var width = x2 - x1;
    var height = y1 - y2;
    item.left = center.x - (width / 2) + dx;
    item.top = center.y + (height / 2) + dy;
}


function getShiftPositions(items, steps) {
    var positions = getItemPositions(items);
    var a = positions.slice(0, steps);
    var b = positions.slice(steps);
    return b.concat(a);
}


function getItemPositions(items) {
    var positions = [];
    for (var i = 0; i < items.length; i++) {
        var item = items[i];
        var center = getCenterPosition(item);
        positions.push(center);
    }
    return positions;
}


function getSortedItems(order, items, tolerance) {
    switch (order) {
        case 'RowLR': return sortRow(items, tolerance);
        case 'ColumnLR': return sortColumn(items, tolerance);
        case 'RowRL': return sortRowRL(items, tolerance);
        case 'ColumnRL': return sortColumnRL(items, tolerance);
        case 'RowLR_Reverse': return sortRow(items, tolerance).reverse();
        case 'ColumnLR_Reverse': return sortColumn(items, tolerance).reverse();
        case 'RowRL_Reverse': return sortRowRL(items, tolerance).reverse();
        case 'ColumnRL_Reverse': return sortColumnRL(items, tolerance).reverse();
        case 'LeftToRight': return items.sort(orderLeftToRight);
        case 'RightToLeft': return items.sort(orderRightToLeft);
        case 'TopToBottom': return items.sort(orderTopToBottom);
        case 'BottomToTop': return items.sort(orderBottomToTop);
    }
}


function sortRow(items, tolerance) {
    return items.sort(function(a, b) {
        var posA = getCenterPosition(a);
        var posB = getCenterPosition(b);
        var distance = Math.abs(posB.y - posA.y);
        if (distance <= tolerance) {
            return posA.x - posB.x;
        }
        return posB.y - posA.y;
    });
}


function sortRowRL(items, tolerance) {
    return items.sort(function(a, b) {
        var posA = getCenterPosition(a);
        var posB = getCenterPosition(b);
        var distance = Math.abs(posB.y - posA.y);
        if (distance <= tolerance) {
            return posB.x - posA.x;
        }
        return posB.y - posA.y;
    });
}


function sortColumn(items, tolerance) {
    return items.sort(function(a, b) {
        var posA = getCenterPosition(a);
        var posB = getCenterPosition(b);
        var distance = Math.abs(posA.x - posB.x);
        if (distance <= tolerance) {
            return posB.y - posA.y;
        }
        return posA.x - posB.x;
    });
}


function sortColumnRL(items, tolerance) {
    return items.sort(function(a, b) {
        var posA = getCenterPosition(a);
        var posB = getCenterPosition(b);
        var distance = Math.abs(posB.x - posA.x);
        if (distance <= tolerance) {
            return posB.y - posA.y;
        }
        return posB.x - posA.x;
    });
}


function orderLeftToRight(a, b) {
    var posA = getCenterPosition(a);
    var posB = getCenterPosition(b);
    return posA.x - posB.x;
}


function orderRightToLeft(a, b) {
    var posA = getCenterPosition(a);
    var posB = getCenterPosition(b);
    return posB.x - posA.x;
}


function orderTopToBottom(a, b) {
    var posA = getCenterPosition(a);
    var posB = getCenterPosition(b);
    return posB.y - posA.y;
}


function orderBottomToTop(a, b) {
    var posA = getCenterPosition(a);
    var posB = getCenterPosition(b);
    return posA.y - posB.y;
}


function getCenterPosition(item) {
    var bounds = item.visibleBounds;
    if (isClipped(item)) bounds = item.pageItems[0].visibleBounds;
    var x1 = bounds[0];
    var y1 = bounds[1];
    var x2 = bounds[2];
    var y2 = bounds[3];
    var width = x2 - x1;
    var height = y1 - y2;
    return {
        x: x1 + width / 2,
        y: y1 - height / 2
    };
}


function isClipped(item) {
    return item.typename == 'GroupItem' && item.clipped;
}


function getPageItems(items) {
    var selection = [];
    for (var i = 0; i < items.length; i++) {
        var item = items[i];
        selection.push(item);
    }
    return selection;
}


function getValue(text) {
    var twoByteChar = /[！-～]/g;
    var value = text.replace(twoByteChar, function(str) {
        return String.fromCharCode(str.charCodeAt(0) - 0xFEE0);
    });
    if (isNaN(value) || !value) return 0;
    return Number(value);
}


function convertUnits(value, unit) {
    try {
        return Number(UnitValue(value).as(unit));
    }
    catch (err) {
        return Number(UnitValue('1pt').as('pt'));
    }
}


function getRulerUnits() {
    var unit = getUnitSymbol();
    if (!app.documents.length) return unit.pt;

    var document = app.activeDocument;
    var src = document.fullName;
    var ruler = document.rulerUnits;
    try {
        switch (ruler) {
            case RulerUnits.Pixels: return unit.px;
            case RulerUnits.Points: return unit.pt;
            case RulerUnits.Picas: return unit.pc;
            case RulerUnits.Inches: return unit.inch;
            case RulerUnits.Millimeters: return unit.mm;
            case RulerUnits.Centimeters: return unit.cm;

            case RulerUnits.Feet: return unit.ft;
            case RulerUnits.Yards: return unit.yd;
            case RulerUnits.Meters: return unit.meter;
        }
    }
    catch (err) {
        switch (xmpRulerUnits(src)) {
            case 'Feet': return unit.ft;
            case 'Yards': return unit.yd;
            case 'Meters': return unit.meter;
        }
    }
    return unit.pt;
}


function xmpRulerUnits(src) {
    if (!ExternalObject.AdobeXMPScript) {
        ExternalObject.AdobeXMPScript = new ExternalObject('lib:AdobeXMPScript');
    }
    var xmpFile = new XMPFile(src.fsName, XMPConst.FILE_UNKNOWN, XMPConst.OPEN_FOR_READ);
    var xmpPackets = xmpFile.getXMP();
    var xmp = new XMPMeta(xmpPackets.serialize());

    var namespace = 'http://ns.adobe.com/xap/1.0/t/pg/';
    var prop = 'xmpTPg:MaxPageSize';
    var unit = prop + '/stDim:unit';

    var ruler = xmp.getProperty(namespace, unit).value;
    return ruler;
}


function getUnitSymbol() {
    return {
        px: 'px',
        pt: 'pt',
        pc: 'pc',
        inch: 'in',
        ft: 'ft',
        yd: 'yd',
        mm: 'mm',
        cm: 'cm',
        meter: 'm'
    };
}


function isValidVersion() {
    var ai2021 = 25;
    var current = parseInt(app.version);
    if (current < ai2021) return false;
    return true;
}


function repeatUndo(count) {
    for (var i = 0; i < count; i++) {
        app.undo();
    }
    app.redraw();
}


function getConfiguration(dialog) {
    var steps = getValue(dialog.steps.text);
    var tolerance = getValue(dialog.tolerance.text);
    var units = getRulerUnits();
    return {
        steps: steps,
        tolerance: convertUnits(tolerance + units, 'pt')
    };
}


